import React from 'react';
import './App.css';
import SignIn from './components/SignIn';
import SignUp from './components/SignUp';
//import Home from './components/Home';
import { BrowserRouter as Router,Switch,Route,Link} from "react-router-dom";

function App() {
  return (
    <React.Fragment>
      <SignUp />
      <Router>
      <Route path="/login">      
        <SignIn />
      </Route>
      </Router>
    </React.Fragment>
  );
}

export default App;
